import gzip
import base64
import os
from pathlib import Path
from typing import Dict

# this is base64 encoded source code
file_data: Dict = {'imet/main.py': '', 'imet/make_submission.py': '', 'imet/models.py': '', 'imet/dataset.py': '', 'imet/senet.py': '', 'imet/densenet.py': '', 'imet/__init__.py': 'H4sIACcV+FwC/8vMLcgvKlFILjPi4uICknrFqSV+pbkhGUWpiSnFGgaaCgrKCmmZFQoF+SWpeSWZiTkKBZUl+UXJGQrl+UXZqUUKmcXFpanFXABAVNvYSQAAAA==', 'setup.py': 'H4sIACcV+FwC/0srys9VKE4tKS0oyc/PKVbIzC3ILyqBiHBxgSkNLgUgyEvMTbVVz8xNLVHXAQsUJCZnJ6anFttGQ0Rjdbg0uQA9nF1NTwAAAA=='}

for path, encoded in file_data.items():
    print(path)
    path = Path(path)
    path.parent.mkdir(exist_ok=True)
    path.write_bytes(gzip.decompress(base64.b64decode(encoded)))


def run(command):
    os.system('export PYTHONPATH=${PYTHONPATH}:/kaggle/working && ' + command)


run('python setup.py develop --install-dir /kaggle/working')

run('python -m imet.main')

run('python -m imet.make_submission')